import React, { useEffect, useState } from "react";
import obtenerPalabras from "../services/vocabularioService";

const Vocabulario = () => {
  const [palabras, setPalabras] = useState({});

  useEffect(() => {
    const cargarPalabras = async () => {
      const palabrasObtenidas = await obtenerPalabras();
      setPalabras(palabrasObtenidas);
    };
    cargarPalabras();
  }, []);

  return (
    <div>
      <h1>Vocabulario en Sueco</h1>
      {Object.keys(palabras).map((categoria) => (
        <div key={categoria}>
          <h2>{categoria}</h2>
          <div className="palabras-categoria">
            {palabras[categoria].map((palabra, index) => (
              <div key={index} className="tarjeta">
                <p><strong>Sueco:</strong> {palabra.sueco}</p>
                <p><strong>Espa√±ol:</strong> {palabra.espanol}</p>
              </div>
            ))}
          </div>
        </div>
      ))}
    </div>
  );
};

export default Vocabulario;
